import React from 'react';

const HeaderMenu = () => (
    <div className='HeaderBar'>
        <nav>
            <img src='D:/LectureAndReport/2022-2/WebFramework/hansung_restaurant_suggest/Logo1.jpg' alt='Taste of Hansung' />
            <span>성신여대입구</span>
            <span>한성대입구</span>
            <span>혜화</span>
        </nav>
    </div>
)

export default HeaderMenu;
